import styled from 'styled-components';

export const Container = styled.View`
  flex: 1;
`;

export const Title = styled.Text`
	text-align: center;
	margin-top: 40;
  font-size: 10;
  color: black;
`;

export const ListPurchases = styled.FlatList``;
